import {
  forwardRef,
  FunctionComponent,
  Ref,
  useCallback,
  useImperativeHandle,
  useReducer,
  useRef
} from 'react';

import Flex from '../../Flex';
import { FormControlProps, HandleValue } from '../../FormControl';
import { useConsolidatedRef, useFocusWithin, useI18n } from '../../../hooks';
import DateTimeProps, {
  DateRangeCallbackParameter,
  DateTimeCallbackParameter,
  DateTimeProperties
} from '../DateTime.types';
import { ForwardProps } from '../../../types';
import { StyledRangeInputContainer } from '../../Input/Input.styles';
import { MinuteInterval } from '../Picker/DatePicker.types';
import FormField from '../../FormField';

import { ClockFormat, parseToDate } from './utils';
import TimeInput from './TimeInput';
import DateTimeInput from './DateTimeInput';

export interface TimeRangeInputProps extends DateTimeProperties {
  /** Object of range boundaries. */
  value?: { start?: DateTimeProps['value']; end?: DateTimeProps['value'] };
  /** Callback fired when inputs value changes. */
  onChange: (value: DateRangeCallbackParameter) => void;
  /** Callback fired when the component gets focused. */
  onFocus?: (value: DateRangeCallbackParameter) => void;
  /** Callback fired when the component loses focus. */
  onBlur?: (value: DateRangeCallbackParameter) => void;
  /** Pass a string or a fragment with an Icon and string for first part of TimeRangeInput. */
  fromLabel?: FormControlProps['label'];
  /** Pass a string or a fragment with an Icon and string for second part of TimeRangeInput. */
  toLabel?: FormControlProps['label'];
  /** Pass an object with "heading" and "content" properties to show AdditionalInfo for second part of DataRangeInput. */
  toAdditionalInfo?: FormControlProps['additionalInfo'];
  /** Pass an object with "heading" and "content" properties to show AdditionalInfo for first part of DataRangeInput. */
  fromAdditionalInfo?: FormControlProps['additionalInfo'];
  /** Controls which input is displayed */
  mode: 'time' | 'datetime';
  /**
   * Display the time with seconds.
   * @default false
   */
  withSeconds?: boolean;
  /**
   * Defines interval for time picker options (in minutes).
   * @default 30
   */
  pickerInterval?: MinuteInterval;
  /** Defines clock format that overrides locale based format */
  clockFormat?: ClockFormat;
  /** Imperative handle */
  handle?: Ref<HandleValue>;
}

type DateRangeAction = { type: 'start' | 'end'; value?: number };
type State = { start?: number; end?: number };

const reducer = (prevState: State, { type, value }: DateRangeAction): State => {
  switch (type) {
    case 'start': {
      return { ...prevState, start: value };
    }
    case 'end': {
      return { ...prevState, end: value };
    }
    default:
      return prevState;
  }
};

const convertToCallbackParameter = (v?: number): DateTimeCallbackParameter => {
  return {
    valueAsISOString: v === undefined || Number.isNaN(v) ? undefined : new Date(v).toISOString(),
    valueAsTimestamp: v
  };
};

const TimeRangeInput: FunctionComponent<TimeRangeInputProps & ForwardProps> = forwardRef(
  (
    {
      value = {},
      onChange,
      onFocus,
      onBlur,
      label,
      fromLabel,
      toLabel,
      labelHidden,
      required,
      readOnly,
      disabled,
      min,
      max,
      withSeconds,
      pickerInterval,
      clockFormat,
      mode,
      status,
      fromAdditionalInfo,
      toAdditionalInfo,
      autoFocus,
      handle,
      ...restProps
    }: TimeRangeInputProps,
    ref: Ref<HTMLDivElement>
  ) => {
    const t = useI18n();

    const startTimeInputRef = useRef<HTMLFieldSetElement>(null);
    const endTimeInputRef = useRef<HTMLFieldSetElement>(null);

    const startTimeClearHandle = useRef<HandleValue>(null);
    const endTimeClearHandle = useRef<HandleValue>(null);

    const [state, dispatch] = useReducer(reducer, {
      start: value.start ? parseToDate(value.start).getTime() : undefined,
      end: value.end ? parseToDate(value.end).getTime() : undefined
    });

    const startTimeRef = useRef<DateTimeCallbackParameter>(convertToCallbackParameter(state.start));
    const endTimeRef = useRef<DateTimeCallbackParameter>(convertToCallbackParameter(state.end));

    useImperativeHandle(
      handle,
      () => ({
        clear: () => {
          startTimeClearHandle.current?.clear();
          endTimeClearHandle.current?.clear();
          const emptyCallbackParameter = convertToCallbackParameter(undefined);
          startTimeRef.current = emptyCallbackParameter;
          endTimeRef.current = emptyCallbackParameter;
          dispatch({ type: 'start', value: undefined });
          dispatch({ type: 'end', value: undefined });
          onChange({
            start: emptyCallbackParameter,
            end: emptyCallbackParameter
          });
        }
      }),
      [onChange]
    );

    const onFocusChange = useCallback(
      (focused: boolean) => {
        (focused ? onFocus : onBlur)?.({
          start: startTimeRef.current,
          end: endTimeRef.current
        });
      },
      [onFocus, onBlur]
    );

    const containerRef = useConsolidatedRef(ref);
    useFocusWithin([containerRef], onFocusChange);

    const commonProps = {
      required,
      readOnly,
      disabled,
      min,
      max,
      status,
      withSeconds,
      pickerInterval,
      clockFormat
    };

    return (
      <FormField
        as='fieldset'
        {...restProps}
        container={{ wrap: 'nowrap' }}
        ref={containerRef}
        labelAs='legend'
        label={label}
        labelHidden={labelHidden}
        disabled={disabled}
        required={required}
        readOnly={readOnly}
        status={status}
      >
        <Flex container as={StyledRangeInputContainer}>
          {mode === 'time' ? (
            <>
              <TimeInput
                {...commonProps}
                value={state.start}
                onBlur={changedValue => {
                  dispatch({
                    type: 'start',
                    value: changedValue.state ? undefined : changedValue.valueAsTimestamp
                  });

                  startTimeRef.current = changedValue;
                  onChange({
                    start: changedValue,
                    end: convertToCallbackParameter(state.end)
                  });
                }}
                label={fromLabel}
                aria-label={`${t('range_from_datetime') + (label ? ` - ${label}` : '')}`}
                additionalInfo={fromAdditionalInfo}
                autoFocus={autoFocus}
                ref={startTimeInputRef}
                handle={startTimeClearHandle}
              />
              <TimeInput
                {...commonProps}
                value={state.end}
                onBlur={changedValue => {
                  dispatch({
                    type: 'end',
                    value: changedValue.state ? undefined : changedValue.valueAsTimestamp
                  });

                  endTimeRef.current = changedValue;
                  onChange({
                    start: convertToCallbackParameter(state.start),
                    end: changedValue
                  });
                }}
                label={toLabel}
                aria-label={`${t('range_to_datetime') + (label ? ` - ${label}` : '')}`}
                additionalInfo={toAdditionalInfo}
                ref={endTimeInputRef}
                handle={endTimeClearHandle}
              />
            </>
          ) : (
            <>
              <DateTimeInput
                {...commonProps}
                value={state.start}
                onBlur={changedValue => {
                  dispatch({
                    type: 'start',
                    value: changedValue.state ? undefined : changedValue.valueAsTimestamp
                  });

                  startTimeRef.current = changedValue;
                  onChange({
                    start: changedValue,
                    end: convertToCallbackParameter(state.end)
                  });
                }}
                label={fromLabel}
                aria-label={`${t('range_from_datetime') + (label ? ` - ${label}` : '')}`}
                additionalInfo={fromAdditionalInfo}
                ref={startTimeInputRef}
                handle={startTimeClearHandle}
              />
              <DateTimeInput
                {...commonProps}
                value={state.end}
                onBlur={changedValue => {
                  dispatch({
                    type: 'end',
                    value: changedValue.state ? undefined : changedValue.valueAsTimestamp
                  });

                  endTimeRef.current = changedValue;
                  onChange({
                    start: convertToCallbackParameter(state.start),
                    end: changedValue
                  });
                }}
                label={toLabel}
                aria-label={`${t('range_to_datetime') + (label ? ` - ${label}` : '')}`}
                additionalInfo={toAdditionalInfo}
                ref={endTimeInputRef}
                handle={endTimeClearHandle}
              />
            </>
          )}
        </Flex>
      </FormField>
    );
  }
);
export default TimeRangeInput;
